import React from "react";
import styled, { css } from "styled-components";

const SearchInput = styled.input`
  border: none;
  padding: 10px;
  background-color: transparent;
  line-height: 22px;
  font-size: 22px;

  ${props => props.customStyles};
`;

export default SearchInput;
